import { FaPlus } from "react-icons/fa";


const Content = () => {
  return (
    <main>
      <input 
        type="text" 
        required 
        autoFocus
        placeholder="Add Item"
        onChange={() => {}} 
      />
      <button>
        <FaPlus />
      </button>
    </main>
  );
};

export default Content;
